import React from 'react';
import AppLayout from "../components/AppLayout"

function Signup(){

    return (
        <>
            <Head>
                <title>
                    signup
                </title>
            </Head>
            <AppLayout>
                my signup
            </AppLayout>
        </>
    )
}

export default Signup;
